from __future__ import print_function
import unittest
from  ImplementstrStr import Solution

class Test_TestImplementstrStr(unittest.TestCase):
    def test_strStr(self):
        self.assertEqual(Solution().strStr('','cdeg'),-1)
        print(Solution().strStr('',''))
        print(Solution().strStr('ac','ab'))
        print(Solution().strStr('abdddcccdefg','c'))
        print(Solution().strStr('abcdefg','cde'))
        print(Solution().strStr('abcdefg','cdeg'))
        print(Solution().strStr('abc','abc'))
        print(Solution().strStr('abcdefg',''))
        print(Solution().strStr('abcd','cde'))
        print(Solution().strStr('aaa','aaaa'))
        print(Solution().strStr("mississippi","issip"))
        print(Solution().strStr("",""))

if __name__ == '__main__':
    unittest.main()
